def toboggan(run, rise, inp):
	x = y = 0
	h = len(inp)
	t = 0
	w = len(inp[0])

	while y < h: #205
		while x >= w:
			inp[y] += inp[y]
			w = len(inp[y])
		if inp[y][x] == "#": t += 1
		x += run
		y += rise
		w = len(inp[0])

	return t

